import { useEffect, useState } from "react";
import "./App.css";
import Train from "./Components/Train/Train";


function App() {

  const [toggle, setToggle] = useState('true');

  const toggleHandler = () => setToggle(!toggle);

  return (
    <div className="App">
      <Train />
      <button onClick={toggleHandler}>Train</button>
    </div>
  );
}

export default App;
